import React from "react";
import styled from "styled-components";

export const LayoutContainer = styled.div`
	position:relative;
	min-width:100vh;
	min-height:100vh;
	border: 3px solid yellow;
	display: grid;
	grid-template-rows: 10px 90px;
	grid-template-columns: 10 90px;
`;
